#
# TABLE STRUCTURE FOR: bills
#

DROP TABLE IF EXISTS `bills`;

CREATE TABLE `bills` (
  `bill_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `clients_number` int(10) unsigned NOT NULL,
  `bill_reference` enum('Order','Parcel') COLLATE utf8_unicode_ci DEFAULT NULL,
  `bill_status` enum('Issued','Paid','Canceled') COLLATE utf8_unicode_ci DEFAULT NULL,
  `bill_amount` int(10) unsigned NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `paid_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`bill_id`),
  UNIQUE KEY `clients_number` (`clients_number`)
) ENGINE=InnoDB AUTO_INCREMENT=601 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `clients_number` varchar(12) COLLATE utf8_unicode_ci NOT NULL,
  `order_type` enum('Ebay-BIN','Ebay-Auction','Online Store','Special Order','Mail-Forwarding') COLLATE utf8_unicode_ci DEFAULT NULL,
  `order_status` enum('Placed','Waiting for payment','Waiting to be purchased','Purchased','Arrived to warehouse','Shipped') COLLATE utf8_unicode_ci DEFAULT NULL,
  `order_price` int(10) unsigned NOT NULL,
  `order_commission` int(10) unsigned NOT NULL,
  `order_warehouse_id` int(10) unsigned DEFAULT 1,
  `created_at` datetime DEFAULT current_timestamp(),
  `modified_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `clients_number` (`clients_number`)
) ENGINE=InnoDB AUTO_INCREMENT=601 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: parcels
#

DROP TABLE IF EXISTS `parcels`;

CREATE TABLE `parcels` (
  `parcel_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `clients_number` int(10) unsigned NOT NULL,
  `parcel_status` enum('Open','Ready for packing','Bill isued','Ready for shipment','Shipped') COLLATE utf8_unicode_ci DEFAULT NULL,
  `parcel_weight` int(10) unsigned NOT NULL,
  `shipping_agent` enum('USPS: EMS','USPS: Priority','Russian Post','First class') COLLATE utf8_unicode_ci DEFAULT NULL,
  `parcel_warehouse_id` int(10) unsigned DEFAULT 1,
  `parcel_address_id` int(10) unsigned NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `modified_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`parcel_id`),
  UNIQUE KEY `clients_number` (`clients_number`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: parcels_addresses
#

DROP TABLE IF EXISTS `parcels_addresses`;

CREATE TABLE `parcels_addresses` (
  `address_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `address_text` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`address_id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: payments
#

DROP TABLE IF EXISTS `payments`;

CREATE TABLE `payments` (
  `payment_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `clients_number` int(10) unsigned NOT NULL,
  `payment_method` enum('Credit card','Paypal','QIWI','Yandex-Money','Promotion') COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_status` enum('Received','Placed','Canceled','Refunded') COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_amount` int(10) unsigned NOT NULL DEFAULT 10,
  `created_at` datetime DEFAULT current_timestamp(),
  `modified_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`payment_id`),
  UNIQUE KEY `clients_number` (`clients_number`)
) ENGINE=InnoDB AUTO_INCREMENT=801 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: permissions
#

DROP TABLE IF EXISTS `permissions`;

CREATE TABLE `permissions` (
  `permission_id` int(10) unsigned NOT NULL,
  `permission_description` enum('Customer','Admin','Super-admin','Developer') COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`permission_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: shop_payments
#

DROP TABLE IF EXISTS `shop_payments`;

CREATE TABLE `shop_payments` (
  `shop_payment_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL,
  `payment_amount` int(11) DEFAULT NULL,
  `shop_payment_method` enum('Company card','Company Paypal','Wire transfer') COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `modified_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`shop_payment_id`)
) ENGINE=InnoDB AUTO_INCREMENT=651 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `login` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `phone` varchar(13) COLLATE utf8_unicode_ci NOT NULL,
  `country` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `city` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `login` (`login`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: users_permissions
#

DROP TABLE IF EXISTS `users_permissions`;

CREATE TABLE `users_permissions` (
  `user_id` int(10) unsigned NOT NULL,
  `user_permission` int(10) unsigned NOT NULL,
  PRIMARY KEY (`user_id`,`user_permission`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: warehouses
#

DROP TABLE IF EXISTS `warehouses`;

CREATE TABLE `warehouses` (
  `warehouse_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `warehouse_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`warehouse_id`),
  UNIQUE KEY `warehouse_name` (`warehouse_name`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



